import React from "react";
import Link from "next/link";

const Header = (props) => {
  return props.loggedIn ? (
    <div className="header flex">
      <div className="header-item">
        <Link href="/">
          <button>Home</button>
        </Link>
      </div>
      <div className="header-item">
        <Link href="/about">
          <button>About</button>
        </Link>
      </div>
    </div>
  ) : (
    <div className="header flex">
      <div className="header-item">Logo ass</div>
    </div>
  );
};

export default Header;
